def transform(sequence):
    index = 0
    while index < len(sequence):
        if sequence[index] != '0':
            index += 1
        else:
            count = 0
            while index < len(sequence) and sequence[index] == '0':
                count += 1
                index += 1
            if index < len(sequence):
                sequence = sequence[:index-count] + '0' + sequence[index:]
    return sequence
